import React from 'react';
import TextField from '@mui/material/TextField';

export const TextFeildForMail = () => {
  return (
    <div>
      <TextField
        required
        fullWidth
        id="email"
        label="Email Address"
        name="email"
        autoComplete="email"
        InputLabelProps={{
          shrink: true,
          style: { whiteSpace: 'nowrap' } // Prevent label text from wrapping
        }}// Ensure label remains visible
      />
    </div>
  );
};
